// Get raw text from previous node (already a string with markdown fences)
const text = $input.first().json.content.parts[0].text;

// Try to extract the JSON block between ```json ... ```
const match = text.match(/```json\s*([\s\S]*?)\s*```/i);

// Fallback: if no fenced block found, try to treat the whole text as JSON
const innerJson = match ? match[1].trim() : text.trim();

let parsed;
try {
  parsed = JSON.parse(innerJson);
} catch (e) {
  throw new Error("Extracted content is not valid JSON: " + e.message + "\nInner text:\n" + innerJson);
}

// Return a valid JSON object
return [{ json: parsed }];
